  `MAA_NAME` varchar(255) DEFAULT NULL COMMENT '市场活动主题',
  `MAA_TYPE_ID` varchar(255) DEFAULT NULL COMMENT '市场活动类型ID(产品ID)',
  `MAA_BEGINNING_DATE` varchar(255) DEFAULT NULL COMMENT '开始日期',
  `MAA_END_DATE` varchar(255) DEFAULT NULL COMMENT '结束日期',
  `MAA_CHARGE_ID` varchar(255) DEFAULT NULL COMMENT '负责人id',
  `HOPE_CUSTOMERS_COUNT` varchar(255) DEFAULT NULL COMMENT '预计客户数',
  `HOPE_COST_AMOUNT` varchar(255) DEFAULT NULL COMMENT '预计成本',
  `ACTUAL_COST_AMOUNT` varchar(255) DEFAULT NULL COMMENT '实际成本',
  `MAA_ADDRESS` varchar(255) DEFAULT NULL COMMENT '活动地点',
  `MAA_DESC` varchar(255) DEFAULT NULL COMMENT '活动描述',
  `MAA_STATUS` varchar(255) DEFAULT NULL COMMENT '状态(N新建，R反馈中，E已启用，P已完成，C已取消)',
  `COA_ORG_ID` varchar(255) DEFAULT NULL COMMENT '创建公司',
  `CREATION_DATE` varchar(255) DEFAULT NULL COMMENT '创建时间',
  `CREATED_BY` varchar(255) DEFAULT NULL COMMENT '创建人',
  `LAST_UPDATE_DATE` varchar(255) DEFAULT NULL COMMENT '最后更新时间',
  `LAST_UPDATED_BY` varchar(255) DEFAULT NULL COMMENT '最后更新人',
  `EXECUTE_ORG_ID` varchar(255) DEFAULT NULL COMMENT '组织id',
  `EXECUTE_DEPT_ID` varchar(255) DEFAULT NULL COMMENT '举办公司',
  `SIGN_UP_DATE` varchar(255) DEFAULT NULL COMMENT '报名截止日期',
  `REC_AMOUNT` varchar(255) DEFAULT NULL COMMENT '个数',
  `MAA_CODE` varchar(255) DEFAULT NULL COMMENT '市场活动编码',
  `TEACHER_ID` varchar(255) DEFAULT NULL COMMENT '讲师id',
  `COMBO_ID` varchar(255) DEFAULT NULL COMMENT '套餐id',
  `MAA_TYPE_FLAG` varchar(255) DEFAULT NULL COMMENT '活动方式标示：P代表产品、C代表套餐',
  PRIMARY KEY (`ACTIVITY_ALL_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `member_activity_all` */

/*Table structure for table `member_customer` */

DROP TABLE IF EXISTS `member_customer`;

CREATE TABLE `member_customer` (
  `CUSTOMER_ID` varchar(255) NOT NULL DEFAULT '' COMMENT '会员id',
  `CUSTOMER_CODE` varchar(255) DEFAULT NULL COMMENT '会员编号',
  `CUSTOMER_NAME` varchar(255) DEFAULT NULL COMMENT '会员姓名',
  `CUS_TYPE` varchar(255) DEFAULT NULL COMMENT '会员等级',
  `CUS_STATUS` varchar(255) DEFAULT NULL COMMENT '状态',
  `CUS_COMPANY` varchar(255) DEFAULT NULL COMMENT '公司名称',
  `CUS_DUTY` varchar(255) DEFAULT NULL COMMENT '职务',
  `CUS_INTRODUCTION` varchar(255) DEFAULT NULL COMMENT '公司简介',
  `CERTIFICATE_NUMBER` varchar(255) DEFAULT NULL COMMENT '证件号码',
  `CUS_SEX` varchar(255) DEFAULT NULL COMMENT '性别',
  `CUS_COUNTRY_ID` varchar(255) DEFAULT NULL COMMENT '国家',
  `CUS_PROVINCE_ID` varchar(255) DEFAULT NULL COMMENT '省份',
  `CUS_CITY` varchar(255) DEFAULT NULL COMMENT '城市',
  `CUS_COUNTY` varchar(255) DEFAULT NULL COMMENT '区县',
  `CUS_BUSINESS_ADDRESS` varchar(255) DEFAULT NULL COMMENT '办公地址',
  `CUS_FAX` varchar(255) DEFAULT NULL COMMENT '传真',
  `CUS_WEB_SITE` varchar(255) DEFAULT NULL COMMENT '网址',
  `CUS_MOBILE_TEL` varchar(255) DEFAULT NULL COMMENT '系统电话（可以更改）',
  `CUS_HOME_ADDRESS` varchar(255) DEFAULT NULL COMMENT '家庭地址',
  `CUS_NOTE` varchar(255) DEFAULT NULL COMMENT '备注',
  `CREATION_DATE` varchar(255) DEFAULT NULL COMMENT '创建时间',
  `CREATED_BY` varchar(255) DEFAULT NULL COMMENT '创建人',
  `LAST_UPDATE_DATE` varchar(255) DEFAULT NULL COMMENT '到期时间',
  `LAST_UPDATED_BY` varchar(255) DEFAULT NULL COMMENT '最后更新人',
  `EDUCATION_ID` varchar(255) DEFAULT NULL COMMENT '教育程度',
  `CUSTOMER_NUMBER` varchar(255) DEFAULT NULL COMMENT '会员上课期号',
  `CUSTOMER_LEVEL` varchar(255) DEFAULT NULL COMMENT '会员等级',
  `CUS_ID_CARD` varchar(255) DEFAULT NULL COMMENT '身份证号',
  `CUS_nation` varchar(255) DEFAULT NULL COMMENT '民族',
  `CUS_YEAR` varchar(255) DEFAULT NULL COMMENT '出生年月日（年.月.日）',
  `CUS_JFJG` varchar(255) DEFAULT NULL COMMENT '签发机关',
  `CUS_Validity_Period` varchar(255) DEFAULT NULL COMMENT '有效期限',
  `CUS_COMPANY_SS` varchar(255) DEFAULT NULL COMMENT '所属分公司',
  `CUS_JF` varchar(255) DEFAULT NULL COMMENT '积分',
  `CUS_frequency` varchar(255) DEFAULT NULL COMMENT '会员上课次数',
  `CUS_TRADE_ID` varchar(255) DEFAULT NULL COMMENT '行业id',
  `CUS_ALAIS` varchar(255) DEFAULT NULL COMMENT '会员别名',
  `CUS_HC_TEL` varchar(255) DEFAULT NULL COMMENT '会场电话',
  PRIMARY KEY (`CUSTOMER_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `member_customer` */

/*Table structure for table `member_order` */

DROP TABLE IF EXISTS `member_order`;

CREATE TABLE `member_order` (
  `ORDER_ID` varchar(100) NOT NULL,
