  `MONEY_COUSOMER_ID` varchar(255) DEFAULT NULL COMMENT '缴费人',
  `OFA_ITEM_ID` varchar(255) DEFAULT NULL COMMENT '成交产品',
  `ITEM_PRICE` varchar(255) DEFAULT NULL COMMENT '产品价格',
  `FOR_SALE_RATE` varchar(255) DEFAULT NULL COMMENT '折扣率',
  `OFA_QUANTITY` varchar(255) DEFAULT NULL COMMENT '成交数量',
  `OFA_PRICE` varchar(255) DEFAULT NULL COMMENT '成交单价(元)',
