  `TK_DATE` varchar(255) DEFAULT NULL COMMENT '退款日期',
  `ISDELETE` varchar(255) DEFAULT NULL COMMENT '是否删除',
  `OFA_POS` varchar(255) DEFAULT NULL COMMENT '票据号',
  PRIMARY KEY (`ORDER_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

